import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
// Importamos los componentes de React-Bootstrap
import { Container, Row, Col, Card, Form, Button, Alert } from 'react-bootstrap';

function Login() {
  const [strUser, setStrUser] = useState('');
  const [password, setPassword] = useState('');
  const [error, setError] = useState(''); // Para mostrar errores
  
  const navigate = useNavigate();

  // (Este hook para verificar sesi√≥n existente no cambia)
  useEffect(() => {
    const userId = localStorage.getItem('IdUser');
    if (userId) {
      alert(`Ya has iniciado sesi√≥n. IdUsuario: ${userId}`);
      navigate('/home');
    }
  }, [navigate]);

  const handleLogin = async (e) => {
    e.preventDefault();
    setError(''); // Limpia errores previos

    if (!strUser || !password) {
      setError('Por favor, ingresa usuario y contrase√±a.');
      return;
    }

    try {
      const response = await fetch('http://127.0.0.1:3111/login', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({ strUser, password }),
      });

      const data = await response.json();

      if (response.ok) {
        localStorage.setItem('IdUser', data.user.id);
        alert(`¬°Login exitoso! Bienvenido ${data.user.username}`);
        navigate('/home');
      } else {
        setError(data.error || 'Credenciales inv√°lidas.');
      }
    } catch (error) {
      console.error('Error de red al intentar iniciar sesi√≥n:', error);
      setError('No se pudo conectar con el servidor.');
    }
  };

  const goToRegister = () => {
    navigate('/register');
  };

  return (
    // Fondo gris claro y centrado vertical/horizontal
    <Container fluid className="d-flex align-items-center justify-content-center" style={{ minHeight: '100vh', backgroundColor: '#f8f9fa' }}>
      <Row>
        <Col>
          {/* Usamos una Card para el dise√±o limpio */}
          <Card style={{ width: '25rem' }} className="shadow-sm">
            <Card.Body className="p-4">
              <div className="text-center mb-4">
                <span style={{ fontSize: '3rem' }} role="img" aria-label="chef">üë®‚Äçüç≥</span>
                <h2 className="mt-2">Tu Chef Virtual</h2>
                <p className="text-muted">Inicia sesi√≥n para ver tus recetas</p>
              </div>
              
              {/* Mostramos errores aqu√≠ */}
              {error && <Alert variant="danger">{error}</Alert>}

              {/* Formulario de Bootstrap */}
              <Form onSubmit={handleLogin}>
                <Form.Group className="mb-3" controlId="formUsername">
                  <Form.Label>Usuario</Form.Label>
                  <Form.Control
                    type="text"
                    placeholder="Tu nombre de usuario"
                    value={strUser}
                    onChange={(e) => setStrUser(e.target.value)}
                  />
                </Form.Group>

                <Form.Group className="mb-3" controlId="formPassword">
                  <Form.Label>Contrase√±a</Form.Label>
                  <Form.Control
                    type="password"
                    placeholder="Tu contrase√±a"
                    value={password}
                    onChange={(e) => setPassword(e.target.value)}
                  />
                </Form.Group>

                {/* Bot√≥n principal */}
                <Button variant="success" type="submit" className="w-100">
                  Iniciar Sesi√≥n
                </Button>
              </Form>
              
              {/* Bot√≥n secundario para registrarse */}
              <div className="text-center mt-3">
                ¬øNo tienes cuenta?
                <Button variant="link" onClick={goToRegister}>
                   Reg√≠strate
                </Button>
              </div>

            </Card.Body>
          </Card>
        </Col>
      </Row>
    </Container>
  );
}

export default Login;
